import styled from "styled-components";

export const Wrapper = styled.div`
    background: linear-gradient(
      to bottom,
      rgba(0, 0, 0, 0) 41%,
      rgba(0, 0, 0, 0.65) 100%
      ),
      url(${({ image }) => image});
`;

export const Context = styled.div`

`;

export const Image = styled.img`
`;
